import styles from './SelectBox.module.scss'
import '../../../sours/icon/style.css'
import { useState } from 'react'




function Items() {
    const data = ['def', 'Kichen']
    return (data.map((item, index) =>
        <div
            key={index}
            className={styles['select-item']
            }>
            {item}
        </div>
    ))
}

export default function SelectBox() {
    const items = Items()
    const [current, setCurrent] = useState(items[0])
    return (
        <div className={styles['select']}>
            <div className={styles['select-header']}>
                <div className={styles['select-current']}>{current}</div>
                <div className={styles['select-icon']}>
                    <i className='ic_arrow_down'></i>
                </div>
            </div>
            <div className={styles['select-body']}>
                {items}
            </div>
        </div>
    )
}
